import React from 'react';
import { NavLink } from 'react-router-dom';
import logoImage from '../../Image/logo.jpg'; 
import { Navbar, Nav } from 'react-bootstrap';
import './Header.css';


function Header() {
  return (
    <Navbar expand="md" className="navbar">
       <img src={logoImage} alt="Пример работы 1" />
      <Navbar.Brand>Элитная мебель</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mx-auto">
          <Nav.Item>
            <NavLink to="/" className="nav-link">Главная</NavLink>
          </Nav.Item>
          <Nav.Item>
            <NavLink to="/about" className="nav-link">О нас</NavLink>
          </Nav.Item>
          <Nav.Item>
            <NavLink to="/catalog" className="nav-link">Каталог</NavLink>
          </Nav.Item>
          <Nav.Item>
            <NavLink to="/contact" className="nav-link">Личный кабинет</NavLink>
          </Nav.Item>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default Header;
